import logo from "./logo.svg";
import "./App.css";
import Section from "./components/Section";
import Toast from "./components/Toast";

function App() {
  return (
    <div className="wrapper">
      <Toast />
      <div className="toast toast-success">
        <main className="toast__message">
          <p className="toast__message-title">Success</p>
          <p className="toast__message-text">Right On!</p>
        </main>
        <button className="toast__button">Dissmiss</button>
      </div>
      <div className="toast toast-warning">
        <main className="toast__message">
          <p className="toast__message-title">Warning</p>
          <p className="toast__message-text">Hmmm!</p>
        </main>
        <button className="toast__button">Dissmiss</button>
      </div>
      <div className="toast toast-error">
        <main className="toast__message">
          <p className="toast__message-title">Error!!</p>
          <p className="toast__message-text">Oh!</p>
        </main>
        <button className="toast__button">Dissmiss</button>
      </div>
    </div>
  );
}

export default App;
